_2:"Our key capabilities:",meetTextList_1:"1. Friendly communication",meetTextList_2:"2. Complete indictaion and implementation of your essential needs",meetTextList_3:"3. Project ends only in case you are fully satisfied with it",meetTextList_4:"4. We are open to a long time cooperation, not only a one-time project",meetText_2:"So who we are?",meetStrong_3:"We are your turbo-booster towards digitalization!",titleBanner_1:"Let’s have a great product",titleBanner_2:"together!",formPlaceholderName:"Name",formPlaceholderMobile:"Phone",chooseTitle:"Why we?",chooseTitle_1:"Just in time",chooseText_1:"We know how sweet managers’ promises could be. That’s why we don’t shift responsibility, ",chooseTextStrong_1:"as we are in charge for all processes personally. ",chooseTitle_2:"Always online",chooseText_2:"And that is not just a words, we do this for real. ",chooseTextStrong_2:"Your business is our #1 priority",chooseText_2_2:"and we will do our best to fit your schedule.",chooseTitle_3:"Fruitful cooperation",chooseText_3:"You look forward to get the result as if we were doing this for ourselves? With our team you could get even more,",chooseStrong:" — we always enjoy to do an extra mile.",chooseTitle_4:"Your goal is our priority",chooseText_4:"Make each project succesful is our top priority, ",titleProcess:"And the process?",cardTitle_1:"Prototype",prototypeItem_1:"Briefing",prototypeItem_2:"Communication with costumer",prototypeItem_3:"Prototyping",cardTitle_2:"Research",researchItem_1:"Search for references",researchItem_2:"Brainstorming",researchItem_3:"Concept",cardTitle_3:"Design",designItem_1:"Fonts",designItem_2:"Color palette",designItem_3:"Creative UI",cardTitle_4:"Adaptiveness",adaptivItem_1:"Version for tabs",adaptivItem_2:"Mobile version",quote:"No common phrases, empty promises and indifferent attitude",footerFormTitle:"Ready to talk?",footerBtn:"Call me back",footerOnline_1:"We are ",footerOnline_2:"online ",always:"always",footerPrivacy:"Privacy policy",foot